// SPDX-License-Identifier: MIT

pragma solidity ^0.8.18;


contract FundMe {

    uint public minimumUsd = 5e18;
    address[] public funders;
    mapping(address funder => uint256 amountFunded) public addressToAmountFunded;

    function fund() public payable {
        // Allow users to send $
        // Have a minimum $ sent
        // 1. How do we send ETH to this conract
        require(msg.value > minimumUsd, "didn't send enough ETH!"); // 1e18 = 1 ETH = 1 * 10 ** 18 WEI
        funders.push(msg.sender);
        addressToAmountFunded[msg.sender] = addressToAmountFunded[msg.sender] + msg.value;

        // What is a revert?
        // Revert is an action have have been udone and send the remaining gas back
    }

    // function withdraw() public {}
    

    

}

